import {
  Stack,
  AppBar
} from "@mui/material";
const Admin = ()=>{
  const design = (
    <>
      <Stack>
        <AppBar position="static">
     <Toolbar>
       <IconButton
         size="large"
         edge="start"
         color="inherit"
         aria-label="menu"
         sx={{ mr: 2 }}
       >
         <MenuIcon />
       </IconButton>
       </Toolbar>
        </AppBar>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
